import React from 'react';
import './sample.css';

const Login = () => {
    return (
        <div className='login'>
        <form>
            <h2>Enter the username OR email: <input type="text"  /></h2>
            <h2>Enter the password: <input type="password" /></h2>
        </form>
        <button>Submit</button>
        </div>
    );
    }
export default Login;
